import React from 'react';
import { Link } from "react-router-dom";

//componenti da react-bootstrap
import { Container, Row, Col } from 'react-bootstrap';

//icone da material ui-icons
import CopyrightIcon from '@material-ui/icons/Copyright';

//Componenti nostre
import Logo from '../../../immagini/logo1.png'

export default class Footer extends React.Component{ 
    constructor(props){ 
       super(props); 
    }
    render(){ 
        return(
        <div className="Footer" > 
            <Container fluid>
                <Row>
                <Col  sm={4}>
                <img src={Logo} alt="Karm-Logo-Footer" width='160em' style={{marginBottom: '2rem'}}/>
                </Col>
                <Col  sm={4}>
                    <h6 style={{color: '#010101', fontWeight: 'bold'}}>Azienda</h6>
                    <Link to="/ChiSiamo"><h6 style={{color: '#010101'}}>Chi Siamo</h6></Link>
                    <a href="/https://www.instagram.com/gab.krr/"><h6 style={{color: '#010101'}}>Instagram</h6></a> 
                </Col>
                <Col  sm={4}>
                    <h6 style={{color: '#010101', fontWeight: 'bold'}}>Contattaci</h6> 
                    <h6 style={{color: '#010101'}}>Gabriele +39 3803719481</h6>
                    <h6 style={{color: '#010101'}}>Salvatore +39 3803719481</h6>
                    <h6 style={{color: '#010101'}}>Maria +39 3803719481</h6>
                    <h6 style={{color: '#010101'}}>Giuseppe +39 3803719481</h6>
                </Col>
                </Row>
                <Row>
                <Col className="Copyright" sm={12} style={{ textAlign: 'center' }}>
                <CopyrightIcon style={{ fontSize: 20}}/> <h6 style={{color: '#010101', fontWeight: 'bold'}}>TEAM KARM 2021</h6>
                </Col>
                </Row>
            </Container>
        </div>
       ); 
    }
 }
